import './App.css';
import { __DATA__ } from "./data";
import {
  MainContainer,
  Container,
  BarChartContainer,
  Number,
  BlackLine,
  MakeBar
} from "./styles";
import Slider from "./slider.js";

export default function App() {
  return (
    <>
    <Container>
      <MainContainer>
        {__DATA__.map(({ distance, colors }, i) => {
          return (
            <BarChartContainer key={i}>
              <MakeBar height={distance * 2} colors={colors} />
            </BarChartContainer>
          );
        })}
      </MainContainer>

    </Container>
    <Slider/>
    </>
  );
}
